DROP TABLE Habitantes;
DROP TABLE Km2;
DROP TABLE Municipios;
DROP TABLE provincias;
DROP TABLE CCAA;

CREATE TABLE IF NOT EXISTS Habitantes (
	ID_MUN	INTEGER NOT NULL UNIQUE,
	HyM	INTEGER NOT NULL,
	Hombres	INTEGER NOT NULL,
	Mujeres	INTEGER NOT NULL,
	PRIMARY KEY(ID_MUN)
);
CREATE TABLE IF NOT EXISTS Km2 (
	ID_MUN	INTEGER NOT NULL UNIQUE,
	Superficie	REAL NOT NULL,
	PRIMARY KEY(ID_MUN)
);
CREATE TABLE IF NOT EXISTS Municipios (
	ID_MUN	INTEGER NOT NULL UNIQUE,
	Nombre	TEXT NOT NULL,
	F_Inscripcion	TEXT,
	ID_PRV	INTEGER NOT NULL,
	N_Municipio	INTEGER NOT NULL,
	PRIMARY KEY(ID_MUN)
);
CREATE TABLE IF NOT EXISTS Provincias (
	ID_PRV	INTEGER NOT NULL PRIMARY KEY AUTO_INCREMENT UNIQUE,
	Nombre	TEXT NOT NULL,
	ID_CCAA	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS CCAA (
	ID_CCAA	INTEGER NOT NULL UNIQUE,
	NombreId	TEXT,
	Nombre	TEXT,
	PRIMARY KEY(ID_CCAA)
);




CREATE VIEW muni_reducido as
select nombre, id_prv
from municipios;
CREATE VIEW muni_extendido as
select municipios.*, superficie, hym
from municipios
join km2 on municipios.id_mun = km2.id_mun
join habitantes on municipios.id_mun = habitantes.id_mun;municipios